import './particle.css'
import Particles from 'react-particles-js'

function Particle(){
    return (
        <div>
            <Particles
  style={{ position: "absolute" }}
  height="95%"
  width="95%"
  params={{
    particles: {
      color: {
        value: "#000000"
      },
      line_linked: {
        color: {
          value: "#000000"
        }
      },
      number: {
        value: 50
      },
      size: {
        value: 3
      }
    }
  }}
/>
        </div>
    );
  }

  export default Particle;
